module.exports = "<header class=\"design container\">\n    <div>\n        <h1 class=\"title\">Iconography</h1>\n        <h2 class=\"sub-title\">Certified Pixel-Perfect</h2>\n\n        <p class=\"description\">\n            Icons are used to represent an action or concept through the most simplistic imagery possible. Icons give additional context to written material, allowing the user to quickly comprehend any given concept. The icons are designed on a highly specific\n            grid to ensure maximum clarity even at a small size. Their design is friendly, human, and bold.\n        </p>\n\n        <p>\n            <a href=\"https://rawgit.com/bullhorn/bullhorn-icons/development/fonts/Bullhorn-Glyphicons.html\">Bullhorn's Icon Set</a>\n        </p>\n    </div>\n    <img src=\"assets/images/IconographyPageIcon.svg\" alt=\"\"/>\n</header>\n<section class=\"design container\">\n    <h2>Icons with Typography</h2>\n    <p>\n        An icon will always have slightly larger dimensions than text when they are paired together. This ensures that the icon is visually the same size as the text and that it scales proportionally.\n    </p>\n\n    <article>\n        <h5>Base sizing</h5>\n        <p>Icons placed next to typography should alays follow this convention.</p>\n\n        <div class=\"base-sizing\">\n            <div class=\"sizing-specs\">\n                <span>Bullhorn Glyphicons</span>\n                <span><strong>Size: </strong>1.29em</span>\n                <span><strong>Padding: </strong>.25em</span>\n                <span><strong>Border Radius: </strong>.625em</span>\n            </div>\n            <div class=\"sizing-demo\">\n                <h1><i class=\"bhi-company\"></i>Company Name</h1>\n            </div>\n        </div>\n    </article>\n\n    <article class=\"entities\">\n        <h5>Padding</h5>\n        <p>\n            Icons should have sufficient padding when followed by text.\n        </p>\n\n        <div class=\"padding\">\n            <div>\n                <h4><i class=\"bhi-circle\"></i>Alice Hughes</h4>\n                <h6><i class=\"bhi-location\"></i>Boston, MA</h6>\n                <span class=\"not-accepted\"><i class=\"bhi-close-o\"></i>I feel squished</span>\n            </div>\n            <div>\n                <h4><i class=\"bhi-circle\"></i>Alice Hughes</h4>\n                <h6><i class=\"bhi-location\"></i>Boston, MA</h6>\n                <span class=\"accepted\"><i class=\"bhi-check\"></i>Much better</span>\n            </div>\n        </div>\n    </article>\n\n    <article>\n        <h2>Entity Icons</h2>\n        <h5>Standard Entity Icons</h5>\n        <p>Used with corresponding entity color.</p>\n\n        <div class=\"example standard-icon-row\">\n            <div>\n                <i theme=\"entity\" class=\"bhi-lead lead\"></i>\n                <p>Lead</p>\n            </div>\n            <div>\n                <i theme=\"entity\" class=\"bhi-person contact\"></i>\n                <p>Contact</p>\n            </div>\n            <div>\n                <i theme=\"entity\" class=\"bhi-company company\"></i>\n                <p>Company</p>\n            </div>\n            <div>\n                <i theme=\"entity\" class=\"bhi-candidate candidate\"></i>\n                <p>Candidate</p>\n            </div>\n            <div>\n                <i theme=\"entity\" class=\"bhi-opportunity opportunity\"></i>\n                <p>Opportunity</p>\n            </div>\n            <div>\n                <i theme=\"entity\" class=\"bhi-job job\"></i>\n                <p>Job</p>\n            </div>\n            <div>\n                <i theme=\"entity\" class=\"bhi-star placement\"></i>\n                <p>Placement</p>\n            </div>\n        </div>\n        <pre><code>\n            &lt;i theme=\"entity\" class=\"bhi-lead lead\">&lt;/i&gt;\n            &lt;h6&gt;Lead&lt;/h6&gt;\n            &lt;i theme=\"entity\" class=\"bhi-person contact\"&gt;&lt;/i&gt;\n            &lt;h6&gt;Contact&lt;/h6&gt;\n            &lt;i theme=\"entity\" class=\"bhi-company company\"&gt;&lt;/i&gt;\n            &lt;h6&gt;Company&lt;/h6&gt;\n            &lt;i theme=\"entity\" class=\"bhi-candidate candidate\"&gt;&lt;/i&gt;\n            &lt;h6&gt;Candidate&lt;/h6&gt;\n            &lt;i theme=\"entity\" class=\"bhi-opportunity opportunity\"&gt;&lt;/i&gt;\n            &lt;h6&gt;Opportunity&lt;/h6&gt;\n            &lt;i theme=\"entity\" class=\"bhi-job job\"&gt;&lt;/i&gt;\n            &lt;h6&gt;Job&lt;/h6&gt;\n            &lt;i theme=\"entity\" class=\"bhi-star placement\"&gt;&lt;/i&gt;\n            &lt;h6&gt;Placement&lt;/h6&gt;\n        </code>\n        </pre>\n    </article>\n\n    <h2>Contained Icons</h2>\n    <h5>Scaling</h5>\n    <p>Make sure to scale the corner radius appropriately when enlarging or decreasing the size of the icon.</p>\n\n    <article class=\"contained-scaling\">\n        <figure>\n            <img src=\"assets/images/IconographyScalingDont.svg\" alt=\"\"/>\n            <figcaption class=\"not-accepted\"><i class=\"bhi-close-o\"></i>That doesn't look like a rectangle</figcaption>\n        </figure>\n        <figure>\n            <img src=\"assets/images/IconographyScalingDo.svg\" alt=\"\"/>\n            <figcaption class=\"accepted\"><i class=\"bhi-check\"></i>Always maintain the proportions</figcaption>\n        </figure>\n    </article>\n\n    <h5>Padding</h5>\n    <p>To preserve readability, icons should have sufficient padding from the edges of their containers. Additionally, the icons should be visually centered in their containers.</p>\n\n    <article class=\"contained-padding\">\n        <figure>\n            <img src=\"assets/images/IconographyPaddingDont.svg\" alt=\"\"/>\n            <figcaption class=\"not-accepted\"><i class=\"bhi-close-o\"></i>It's getting crowded in here</figcaption>\n        </figure>\n        <figure>\n            <img src=\"assets/images/IconographyPaddingDo.svg\" alt=\"\"/>\n            <figcaption class=\"accepted\"><i class=\"bhi-check\"></i>It's good to have some breathing room</figcaption>\n        </figure>\n    </article>\n\n    <article>\n        <h5>Examples</h5>\n\n        <div class=\"example contained-icon-row\">\n            <h1><i theme=\"contained\" class=\"bhi-lead lead\"></i>Heading One</h1>\n            <h2><i theme=\"contained\" class=\"bhi-person contact\"></i>Heading Two</h2>\n            <h3><i theme=\"contained\" class=\"bhi-company company\"></i>Heading Three</h3>\n            <h4><i theme=\"contained\" class=\"bhi-candidate candidate\"></i>Heading Four</h4>\n            <h5><i theme=\"contained\" class=\"bhi-opportunity opportunity\"></i>Heading Five</h5>\n            <h6><i theme=\"contained\" class=\"bhi-job job\"></i>Heading Six</h6>\n            <!-- <p><i theme=\"contained\" class=\"bhi-star placement\"></i>Body</p> -->\n        </div>\n        <pre><code class=\"hljs xml\">\n            &lt;h1&gt;&lt;i theme=\"contained\" class=\"bhi-lead lead\"&gt;&lt;/i&gt;Heading One&lt;/h1&gt;\n            &lt;h2&gt;&lt;i theme=\"contained\" class=\"bhi-person contact\"&gt;&lt;/i&gt;Heading Two&lt;/h2&gt;\n            &lt;h3&gt;&lt;i theme=\"contained\" class=\"bhi-company company\"&gt;&lt;/i&gt;Heading Three&lt;/h3&gt;\n            &lt;h4&gt;&lt;i theme=\"contained\" class=\"bhi-candidate candidate\"&gt;&lt;/i&gt;Heading Four&lt;/h4&gt;\n            &lt;h5&gt;&lt;i theme=\"contained\" class=\"bhi-opportunity opportunity\"&gt;&lt;/i&gt;Heading Five&lt;/h5&gt;\n            &lt;h6&gt;&lt;i theme=\"contained\" class=\"bhi-job job\"&gt;&lt;/i&gt;Heading Six&lt;/h6&gt;\n            <!-- &lt;p&gt;&lt;i theme=\"contained\" class=\"bhi-star placement\"&gt;&lt;/i&gt;Body&lt;/p&gt; -->\n        </code>\n        </pre>\n    </article>\n</section>\n"

